import scala.language.higherKinds

trait Typed { this: RowLike =>
  import CoreTypes._
  def typed(columnIndex: Int, scalaTypeName: String): Any = scalaTypeName match {
    case "Int"                        => convInt(this, columnIndex)
    case "Long"                       => convLong(this, columnIndex)
    case "Double"                     => convDouble(this, columnIndex)
    case "Boolean"                    => convBoolean(this, columnIndex)
    case "scala.math.BigDecimal"      => convBigDecimal(this, columnIndex)
    case "scala.math.BigInt"          => convBigInt(this, columnIndex)
    case "java.lang.String"           => convString(this, columnIndex)
    case "java.sql.Date"              => convSqlDate(this, columnIndex)
    case "java.sql.Timestamp"         => convSqlTimestamp(this, columnIndex)
    case "java.sql.Time"              => convSqlTime(this, columnIndex)
    case "java.time.LocalDate"        => convLocalDate(this, columnIndex)
    case "java.time.LocalDateTime"    => convLocalDatetime(this, columnIndex)
    case "java.time.LocalTime"        => convLocalTime(this, columnIndex)
    case "java.lang.Integer"          => convJInt(this, columnIndex)
    case "java.lang.Long"             => convJLong(this, columnIndex)
    case "java.lang.Double"           => convJDouble(this, columnIndex)
    case "java.math.BigDecimal"       => convJBigDecimal(this, columnIndex)
    case "java.math.BigInteger"       => convJBigInteger(this, columnIndex)
    case "java.lang.Boolean"          => convJBoolean(this, columnIndex)
    case "Array[Byte]"                => convByteArray(this, columnIndex)
    case "java.io.InputStream"        => convInputStream(this, columnIndex)
    case "java.io.Reader"             => convReader(this, columnIndex)
    case "java.sql.Blob"              => convBlob(this, columnIndex)
    case "java.sql.Clob"              => convClob(this, columnIndex)
    case "java.sql.Array"             => convArray(this, columnIndex)
    case _                            => convAny(this, columnIndex)
  }
  def typed[T](columnIndex: Int)(implicit c: CoreTypes.Converter[T]): T = c(this, columnIndex)
  def typed[T: CoreTypes.Converter]: T = typed(0)
  def typed[T: CoreTypes.Converter](name: String): T
}

trait TypedResult[+R <: RowLike] { this: Result[R] =>

  def head[T: CoreTypes.Converter]: T =
    headOption[T].getOrElse(throw new NoSuchElementException("No rows in result"))

  def headOption[T: CoreTypes.Converter]: Option[T] =
    try
      if (hasNext) {
        next()
        Some(this.asInstanceOf[RowLike].typed[T])
      } else None
    finally close

  /** Used by tresql scala macro to convert result to single value */
  def headValue(typeName: String): Any =
    headOptionValue(typeName).getOrElse(throw new NoSuchElementException("No rows in result"))
  /** Used by tresql scala macro to convert result to single value */
  def headOptionValue(typeName: String): Option[Any] =
    try
      if (hasNext) {
        next()
        Some(this.asInstanceOf[RowLike].typed(0, typeName))
      } else None
    finally close

  def unique[T: CoreTypes.Converter]: T =
    uniqueOption[T].getOrElse(throw new NoSuchElementException("No rows in result"))

  def uniqueOption[T: CoreTypes.Converter]: Option[T] =
    try if (hasNext) {
      next()
      val v = this.asInstanceOf[RowLike].typed[T]
      if (hasNext) throw new TooManyRowsException("More than one row for unique result")
      else Some(v)
    } else None
    finally close

  def list[T: CoreTypes.Converter]: List[T] =
    this.map(r => this.asInstanceOf[RowLike].typed[T]).toList

